import React from "react";
import { Link } from "react-router-dom";
import "./Navigation.css";

function Navigation() {
  return (
    <div className="nav">
      <Link to="/">HOME</Link>
      <Link to={{ pathname: "/about", state: { fromNavigation: true } }}>
        ABOUT
      </Link>
    </div>
  );
}

export default Navigation;
